import React from 'react';
import Cards from './Cards';

const CardLists = (robots)=>{
    const cardComponent=robots.map((user,i)=>{
        return < Cards id={robots[i].id}
                 name={robots[i].name}
                 email={robots[i].email} 
                 />;
    });
    return(
        <div>{cardComponent}</div>
    )
}

export default CardLists;
